import React, { Component } from 'react';
class Polygon extends Component{
    constructor(props) {
        super(props);
        this.mymap = props.__map__;

    }


    componentDidMount(){
        this.mymap.add(this.marker1);
    }


    render(){
        return (null)
    }
}

export default Polygon;
